import React from 'react'
import '../styles/App.css'

const TableHead = (props) => {

  return (
    <div className="header">
      <div className="cell">
        <strong>
          {props.tableHeaders.date} {props.tableHeaders.name}{" "}
          {props.tableHeaders.quantity} {props.tableHeaders.distance}
        </strong>
      </div>
    </div>
  );
}

export default TableHead
